(17, 15, 'The World of Warcraft Diary', 'What did it take to make World of Warcraft? Blizzards first 3D level designer provides an in-depth view of making computer games.', 'The WoW Diary provides a candid and detailed look at the twists and turns inside computer game development. Its author was WoWs first 3D level designer and he writes about the people behind the game and the philosophy behind their work. \r\n\r\nThe WoW Diary will be a hardbound journal with over 95,000 words and 130 images across 336 varnished, full-color pages of high-quality paper stock printed in the U.S.A.', '15-wow_diary.jpg', 'Education', 'Thane', 'Maharashtra', 'www.wowdiary.com', 123456, 0, 15, '2018-03-31 09:23:59', 4, 0, 0, 0x776f775f64696172792e6a7067, 0, 0, 0.2125, 0, 123456, '7643aa'),
(18, 16, 'New Robot to Explore the Depths of Yellowstone Lake.', 'We are engineers and explorers who plan to help Yellowstone scientists make what could be tomorrows greatest discoveries.', 'Yellowstone started a proud tradition of protecting our planetâ€™s most unique environments when it became the worldâ€™s first National Park more than a century ago. However, there is a part of Yellowstone that very few people have visited. An entire ecosystem that is hidden from us at the surface. A place that scientists are eager to study and may harbor unknown life; the depths of Yellowstone Lake.', '16-rocket.jpg', 'Education', 'Thane', 'Arunachal Pradesh', 'www.yellowstone.com', 0, 10, 10, '2018-03-31 10:30:41', 4, 0, 0, 0x726f636b65742e6a7067, 0, 0, 0, 1, 0, ' '),
(19, 16, 'The Urban Death Project: Laying Our Loved Ones to Rest', 'What if we could grow new life after we have died? Now we can.', 'The Urban Death Project is raising funds to support the ongoing design and implementation of a new option for laying our loved ones to rest. Itâ€™s a way for our deaths to be more like our lives â€“ full of meaning and a deep respect for the earth. Itâ€™s also a way that we can continue living on in our communities, even after weâ€™ve died. Check it out, be inspired, and join our work!', '16-soil.png', 'Education', 'Mumbai (ex Bombay)', 'Maharashtra', 'www.susa.org', 10000, 10, 15, '2018-03-31 10:35:35', 2, 0, 0, 0x736f696c2e706e67, 2003000, 0, 0, 1, 12345, '87663AA');

